import React from 'react';
import logo from './logo.svg';
import {Provider,defaultTheme,Button} from '@adobe/react-spectrum';
import './App.css';

function App() {
  return (
    <Provider theme={defaultTheme}>
      <Button variant="cta">Hello React Spectrum!</Button>
    </Provider>
  );
}

export default App;
